import React from 'react' ; 

let web ="" ; 
let design = "" ; 

function Text(){
    return (
        <div className="container  ">
        <p className=" " > <span className={web}>Web</span> <span className={design}>design</span>
         encompasses many different skills and disciplines
          in the production and maintenance of websites.
           The different areas of <span  className={web}>Web</span> <span className={design}>design</span> include
           <span  className={web}>Web</span> graphic <span className={design}>design</span>; user interface <span className={design}>design</span> (UI <span className={design}>design</span>); authoring, including standardised code and proprietary software; user experience <span className={design}>design</span> (UX <span className={design}>design</span>);
         and search engine optimization.
        </p>

        </div>
    );
}

export default Text ;
